import { makeStyles, createMuiTheme } from "@material-ui/core";

const useStyles = makeStyles({
  header: {
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    marginBottom: 30
  }
});

export { useStyles };
